import {useState} from 'react';

export default function Main() {

  let [count, setCount] = useState(0)

  function Add() {
    setCount(count + 5)
  }


  return (
    <div className='container mt-4'>
      <h1>{count}</h1>
      <button className='btn btn-primary mt-4' onClick={Add}>Add</button>
      <button className='btn btn-primary mt-4  ms-3'>Subtract</button>
    </div>
  )
}
